import React from "react";



function Social(){
    return(
        
        <div className="social">
                <a href="https://facebook.com/institutolap" className="fa fa-facebook" target="_blank"></a>
                <a href="https://twitter.com/institutolap" className="fa fa-twitter" target="_blank"></a>
                <a href="https://instagram.com/institutolap" className="fa fa-instagram" target="_blank"></a>
            </div>
    
    
        
    )
}

export default Social;
